import useFetch from './service/service';
import './App.css';


function App() {
  const {data, loading, error} = useFetch("http://localhost:3000/user/12")

  if(loading) return <h1>LOADING ...</h1>
  if(error) console.log(error);
  return (
    <div className="App">
        <p>
          {data.id}
        </p>
    </div>
  );
}

export default App;
